import React, { Fragment, useState } from "react";
import { Link, Redirect } from "react-router-dom";
import { connect } from "react-redux";
import { setAlert } from "../../actions/alert";
import { registerOpcen } from "../../actions/opcen";
import PropTypes from "prop-types";
import { loadUser } from "../../actions/auth";
import store from "../../store";

const Dashboard_opcen = props => {
  const [formData, setFormData] = useState({
    name: "",
    category: "",
    description: "",
  });
  //destructure so you would do formData.name formData.number
  //Object Syntax use {}
  const { name, category, description } = formData;

  const onChange = async c =>
    setFormData({ ...formData, [c.target.name]: c.target.value });

  const onSubmit = async c => {
    c.preventDefault();
    registerOpcen({ name, category, description });
  };
  //   if (isAuthenticated) {
  //     return <Redirect to={`/operation-center/${user}`} />;
  //   }

  useEffect(() => {
    store.dispatch(loadUser());
  }, []);

  return (
    <Fragment>
      <div
        style={{
          padding: "20px",
          background: "#fff",
          borderRadius: "10px",
        }}
      >
        <div
          style={{
            display: "block",
            borderRadius: "10px",

            padding: "20px",
          }}
        >
          <h1 className='large text-primary'> Operation Center Console</h1>
        </div>

        <div
          style={{
            display: "flex",
            flexDirection: "row",
            width: "100%",
            justifyContent: "space-around",
          }}
        >
          <Link className='bigIcon'>
            <div style={{ marginTop: "30%" }}>
              <i className='fas fa-landmark' aria-hidden='true'></i>
              <p> Government</p>
              <small className='small-txt-blk'>
                (Agencies, Province, City)
              </small>
            </div>
          </Link>
          <Link className='bigIcon'>
            <div style={{ marginTop: "30%" }}>
              <i className='fa fa-hand-paper-o' aria-hidden='true'></i>
              <p> Volunteer Org.</p>
              <small className='small-txt-blk'>(Rotary,JCI, )</small>
            </div>
          </Link>
          <Link className='bigIcon'>
            <div style={{ marginTop: "30%" }}>
              <i className='fa fa-building-o' aria-hidden='true'></i>
              <i aria-hidden='true'></i>
              <p> Private</p>
              <small className='small-txt-blk'>
                (Construction, Utilities etc. )
              </small>
            </div>
          </Link>
        </div>
      </div>
    </Fragment>
  );
};

Dashboard_opcen.propTypes = {
  props: PropTypes,
};

const mapStateToProps = state => ({});

const mapDispatchToProps = {};

export default connect(mapStateToProps, mapDispatchToProps)(Dashboard_opcen);
